import React from "react";
import "./pics.css";
import Cards, { Card } from "react-bootstrap";
import CardItem from "./CardItem";
export default function Picture() {
  return (
    <div className="cards">
    <div className="cards__container">
      <div className="cards__wrapper">
        <ul className="cards__items">
        <Card style={{ width: "22rem" }}>
        <Card.Body>
            <Card.Img src="images/IMG_2207.jpeg"/>
          <Card.Title style={{ color: "green" }}>Discrete Mathematics</Card.Title>
          <Card.Subtitle className="mb-2 text-muted">
            Concepts of abstraction, encapsulation, inheritance and much more.
          </Card.Subtitle>
          {/* <Card.Text>
            GeeksforGeeks provides a platform for all the students to study
            about all the subjects in CSE.
          </Card.Text> */}

        </Card.Body>
      </Card>
        </ul>
      </div>
    </div>
  </div>
    // <div className="picHolder">
    //   <div className="image">

    //   </div>
    //   <div className="discr">{/* <h1>Software/Web Deverloper</h1> */}</div>
    // </div>
  );
}
